description:
File Scavenger can recover data accidentally deleted, removed from the Recycle Bin and files on corrupted, deleted or reformatted partitions. Files are recovered with the original filename, folder path and dates. File Scavenger can also reconstruct broken RAID or spanned volumes. 

Info:

- Run Application
- Click on &quot;Install Now&quot; Install Software
- Click on &quot;License&quot;
- Follow the instructions given.
